export default function GoogleForm() {
  return (
    <div style={{ width: "100%" }}>
      <h2>Google Forms Embedded</h2>
      <iframe
        title="Google Forms"
        src="https://docs.google.com/forms/d/e/1FAIpQLScK2NcGBUvQilhJkHazZplpKXprO39a3YsiQxt5wM5fCU8Epw/viewform?embedded=true"
        style={{ border: "none", width: "100%" }}
        allowFullScreen
        webkitAllowFullScreen
        mozAllowFullScreen
        msallowFullScreen
      >
        Loading...
      </iframe>
    </div>
  );
}
